window.bookSummaryJSON = "<p>William Kent Krueger is a <i>New York Times</i> best-selling author whose popular Cork O’Connor mysteries display an \"intimate knowledge of Minnesota’s northern reaches and respect for Native American life\" (<i>Publishers Weekly</i>). In <i>Tamarack County</i>, former sheriff Cork O'Connor investigates the disappearance of a retired judge’s wife - and discovers the bloody aftermath of a 20-year-old crime.</p>"; 
